import React from 'react';
import Image from "next/image";
import styled from "styled-components";

const Blogs = styled.section`
  width: 100%;
  height: 100vh;
  background: url("./images/home/hotel-bg.jpg") no-repeat;
  background-size: cover;
  background-attachment: fixed;
  display: flex;
`


const Section3 = () => {

    return (
        <div className={'relative'}>
            {/*<Blogs>
                <div className={'w-1/3 text-white'}>left</div>
                <div className={'w-2/3 text-white'}>right</div>
            </Blogs>*/}
            <Image
                layout={'fill'}
                src={'/images/home/hotel-bg.jpg'}
                loading={"lazy"}
                objectFit={"cover"}
            />
        </div>
    );
}

export default Section3;
